INSERT INTO `mdl_assign` VALUES (1,2,'Group Project – Digital Transformation Case Study Analysis','<p>Working in your assigned groups, prepare a comprehensive analysis of the digital transformation case study you selected earlier (Google, Siemens, or IKEA). Your report should demonstrate how course concepts apply to a real-world organizational setting.</p>',1,1,0,0,1,0,1754755200,1754150400,100,1754157860,0,1,0,1755360000,1,0,0,0,0,0,'untilpass',2,0,0,0,1,1,'<p data-start=\"589\" data-end=\"645\"><strong data-start=\"589\" data-end=\"644\">Your submission must include the following sections</strong>:</p>\r\n<ol data-start=\"647\" data-end=\"993\">\r\n<li data-start=\"647\" data-end=\"700\">\r\n<p data-start=\"650\" data-end=\"700\"><strong data-start=\"650\" data-end=\"698\">Introduction to the organization and context</strong></p>\r\n</li>\r\n<li data-start=\"701\" data-end=\"753\">\r\n<p data-start=\"704\" data-end=\"753\"><strong data-start=\"704\" data-end=\"751\">The digital transformation strategy applied</strong></p>\r\n</li>\r\n<li data-start=\"754\" data-end=\"827\">\r\n<p data-start=\"757\" data-end=\"827\"><strong data-start=\"757\" data-end=\"825\">Key technologies and tools used (e.g., AI, Cloud, Digital Twins)</strong></p>\r\n</li>\r\n<li data-start=\"828\" data-end=\"893\">\r\n<p data-start=\"831\" data-end=\"893\"><strong data-start=\"831\" data-end=\"891\">Business process changes (modeled in BPMN if applicable)</strong></p>\r\n</li>\r\n<li data-start=\"894\" data-end=\"953\">\r\n<p data-start=\"897\" data-end=\"953\"><strong data-start=\"897\" data-end=\"951\">Outcomes, lessons learned, and critical evaluation</strong></p>\r\n</li>\r\n<li data-start=\"954\" data-end=\"993\">\r\n<p data-start=\"957\" data-end=\"993\"><strong data-start=\"957\" data-end=\"991\">Conclusion and recommendations</strong></p>\r\n</li>\r\n</ol>\r\n<p data-start=\"995\" data-end=\"1010\"><strong data-start=\"995\" data-end=\"1009\">Guidelines</strong>:</p>\r\n<ul data-start=\"1011\" data-end=\"1178\">\r\n<li data-start=\"1011\" data-end=\"1038\">\r\n<p data-start=\"1013\" data-end=\"1038\">Length: 2000–2500 words</p>\r\n</li>\r\n<li data-start=\"1039\" data-end=\"1062\">\r\n<p data-start=\"1041\" data-end=\"1062\">Format: PDF or DOCX</p>\r\n</li>\r\n<li data-start=\"1063\" data-end=\"1097\">\r\n<p data-start=\"1065\" data-end=\"1097\">Include references (APA style)</p>\r\n</li>\r\n<li data-start=\"1098\" data-end=\"1178\">\r\n<p data-start=\"1100\" data-end=\"1178\">All group members must contribute and will be asked to submit peer evaluations</p>\r\n</li>\r\n</ul>',1,0,0,0),(2,2,'Group Project – Digital Transformation Case Study Analysis - Week 3','<p>Working in your assigned groups, prepare a comprehensive analysis of the digital transformation case study you selected earlier (Google, Siemens, or IKEA). Your report should demonstrate how course concepts apply to a real-world organizational setting.</p>',1,1,0,0,0,0,1754755200,1754150400,100,1754157827,0,1,0,1755360000,1,0,0,0,0,0,'untilpass',2,0,0,0,1,1,'<p data-start=\"589\" data-end=\"645\"><strong data-start=\"589\" data-end=\"644\">Your submission must include the following sections</strong>:</p>\r\n<ol data-start=\"647\" data-end=\"993\">\r\n<li data-start=\"647\" data-end=\"700\">\r\n<p data-start=\"650\" data-end=\"700\"><strong data-start=\"650\" data-end=\"698\">Introduction to the organization and context</strong></p>\r\n</li>\r\n<li data-start=\"701\" data-end=\"753\">\r\n<p data-start=\"704\" data-end=\"753\"><strong data-start=\"704\" data-end=\"751\">The digital transformation strategy applied</strong></p>\r\n</li>\r\n<li data-start=\"754\" data-end=\"827\">\r\n<p data-start=\"757\" data-end=\"827\"><strong data-start=\"757\" data-end=\"825\">Key technologies and tools used (e.g., AI, Cloud, Digital Twins)</strong></p>\r\n</li>\r\n<li data-start=\"828\" data-end=\"893\">\r\n<p data-start=\"831\" data-end=\"893\"><strong data-start=\"831\" data-end=\"891\">Business proc